var App, Sprout;

Sprout = window.Sprout || {};

App = new Backbone.Marionette.Application();

App.addRegions({
  projects: ".app-container"
});

App.addInitializer(function() {
  var ProjectList, mainView;
  ProjectList = Sprout.View.ProjectList;
  mainView = new ProjectList;
  return App.projects.show(mainView);
});

window.Sprout.App = App;

$(document).ready(function() {
  App.start();
  return console.log(Sprout);
});

